import React, { useState, useEffect, useRef } from "react";
import { motion } from "framer-motion";
import './HomePage.css';

import Banner from './Banner';
import AboutSection from './AboutSection';
import ExclusiveRights from "./ExclusiveRights";
import ContactSection from "./ContactSection";
import OurPartners from "./OurPartners";
import CountdownTimer from "./CountdownTimer";

const sectionVariants = {
  hidden: { opacity: 0, y: 50 },
  visible: { opacity: 1, y: 0, transition: { duration: 0.8, ease: "easeOut" } }
};

const Homepage = () => {
  const [isDragging, setIsDragging] = useState(false);
  const [position, setPosition] = useState({ x: window.innerWidth - 80, y: window.innerHeight - 80 }); // initial bottom-right
  const iconRef = useRef(null);

  const handleClick = () => {
    if (!isDragging) {
      window.open("https://franmaxindia.com", "_blank");
    }
  };

  // Keep icon inside screen when window resizes
  useEffect(() => {
    const handleResize = () => {
      setPosition(prev => ({
        x: Math.min(prev.x, window.innerWidth - 60),
        y: Math.min(prev.y, window.innerHeight - 60),
      }));
    };
    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  // Clamp position inside viewport
  const clamp = (value, min, max) => Math.min(Math.max(value, min), max);

  return (
    <div className="homepage">
      <main className="main-content">

        <motion.div initial="hidden" animate="visible" variants={sectionVariants}>
          <Banner />
        </motion.div>

        <motion.div initial="hidden" whileInView="visible" viewport={{ once: true, amount: 0.2 }} variants={sectionVariants}>
          <AboutSection />
        </motion.div>

        <motion.div initial="hidden" whileInView="visible" viewport={{ once: true, amount: 0.2 }} variants={sectionVariants}>
          <ExclusiveRights />
        </motion.div>

        <motion.div initial="hidden" whileInView="visible" viewport={{ once: true, amount: 0.2 }} variants={sectionVariants}>
          <CountdownTimer />
        </motion.div>

        <motion.div initial="hidden" whileInView="visible" viewport={{ once: true, amount: 0.2 }} variants={sectionVariants}>
          <OurPartners />
        </motion.div>

        <motion.div initial="hidden" whileInView="visible" viewport={{ once: true, amount: 0.2 }} variants={sectionVariants}>
          <ContactSection />
        </motion.div>

      </main>

      {/* ================= Draggable Free-floating Image ================= */}
<motion.img
  ref={iconRef}
  src={require('../assets/9e5d6c19234ec1aeeba6b782e7c31073.jpg')}
  alt="Draggable Link"
  drag
  dragMomentum={true}
  dragElastic={0.3}
  className="floating-icon"
  style={{
    position: 'fixed',
    bottom: 30,   // initial start
    right: 30,    // initial start
    width: 60,
    height: 60,
    borderRadius: '10%',
    cursor: 'grab',
  }}
  onDragStart={() => setIsDragging(true)}
  onDragEnd={(event, info) => {
    setTimeout(() => setIsDragging(false), 50);

    // Clamp the icon inside screen after drag
    const clampedX = Math.min(Math.max(info.point.x - 30, 0), window.innerWidth - 60);
    const clampedY = Math.min(Math.max(info.point.y - 30, 0), window.innerHeight - 60);
    iconRef.current.style.left = clampedX + 'px';
    iconRef.current.style.top = clampedY + 'px';
  }}
  onClick={handleClick}
  whileHover={{ scale: 1.05 }}
  whileTap={{ scale: 0.95 }}
/>

    </div>
  );
};

export default Homepage;
